import "./Card.css";

function Card() {
  return (
    <>
      <div class="card" style="width: 20rem;">
        <img class="card-image" src="dark.jpg" />
        <div class="card-content">
          <p class="card-title"> Card Title </p>
          <p class="card-desc"> What is Lorem Ipsum Lorem Ipsum is </p>
          <button>Click Here</button>
        </div>
      </div>
    </>
  );
}

export default Card;
